webpackJsonp([0xa4f27abca8ab],{4274:function(a,t){a.exports={data:{markdownRemark:{html:'<p>ネタ切れ→ネタ補充の時間がない→スパイラルモデル。いや、厳密にはネタは腐るほどあるんだが、実際本当に腐ってるんだ。ネタを具現化する時間が取れず、もう賞味期限切れなのがほとんど。</p>\n<h2>Web通販について</h2>\n<p>1月2日の日記で告知したとおり、時封城の生産を打ち切りました。<a href="http://e.danmaq.com/">あとは残り在庫の80枚でおしまい</a>ですので、プレイしたい方はお早めにどうぞ。</p>\n<h2>夢終劇について</h2>\n<p>再販します。ただし弾幕風から.NETに移植したものとなります。 (ちょい弾幕風のエロい人と連絡付かないのもありますし、その他諸々大人の事情で)すでにシステム部分はほぼ完成、あとはプログラム部分は自機の動きとか敵機の動きとかをしこしこと組み込むだけです。(あ、リプレイ部分がまだだったな\'Ａ｀)グラフィックとサウンドも既に変換済み。むしろここで時間かかるのが背景グラフィックかな。弾幕風ではプリミティブだけで背景こさえてたんで、それをモデルに移行するためにBlenderとひぃひぃ言いながら格闘中。ヘタすっとこれだけで数か月つぶせるかも。そんなわけで再販、ってか移植版を作りますが、時封城v2みたいにならないよう、今はいつリリースかは公表しません。</p>\n<h2>2011/4/1追記</h2>\n<p><a href="/3705">リリース時期は2011年末に決定しました</a>。</p>',frontmatter:{cover:null,date:"2009-04-01T00:00:00+09:00",strDate:"2009/3/31",title:"いろいろ近況"}}},pathContext:{path:"/ja/blog/2009/04/01-いろいろ近況/",langKey:"ja"}}}});
